const About = () => (
  <Layout>
    <div>
      <h1>About BitzPrice</h1>
      <p>
        BitzPrice is an app that allows you to check the current Bitcoin (BTC)
        price in multiple currencies, including USD, GBP & EUR.
      </p>
    </div>
  </Layout>
);

export default About;
